  return 'Hi havia una vegada una mare \xE0nega que ponia els ous prop d\u2019un estany. A poc a poc van sortir tots els aneguets, excepte un, que va tardar una mica m\xE9s. I quan ho va fer, tots els van mirar estranyats, ja que no era un pollet rodonet i de plomes grogues com els altres, sin\xF3 un pollet de plomes grises i un bec gran i desmanegat. Els pollets li deien: -Ets un aneguet lleig, no et volem amb nosaltres! I es van llen\xE7ar a l\u2019aigua darrera la mare \xE0nega perqu\xE8 tenien pressa per aprendre a nedar, deixant-lo sol i esporuguit.\r\nAix\xED que es va trobar sol, va marxar a buscar aixopluc en una granja propera. All\xED, per\xF2, els gats i gossos se\u2019n reien del seu aspecte i va decidir marxar al bosc i amagar-se.\r\nVa passar el temps i va arribar de nou la primavera, i l\u2019aneguet va sortir del seu cau i es va dirigir a l\u2019estany a beure aigua. Quan es va apropar a l\u2019aigua es va quedar meravellat del que veia: un animal blanc com la neu, amb un coll llarg i estilitzat se\u2019l mirava bocabadat...Era ell!\r\nPer all\xED passava llavors un cigne i les seves cries nedant lentament quan se li van acostar i li van dir si volia unir-se a ells, car ell tamb\xE9 n\u2019era un, de cigne, un dels animals m\xE9s bells de tot el m\xF3n. I ell va reunir-se amb la seva nova fam\xEDlia, content per sempre m\xE9s.\r\nI conte contat, ja s\u2019ha acabat. \r\n';
