_.getText = function getText_1(){
  return "Hi havia una vegada una habitaci\xF3 d\u2019uns nens on havia moltes joguines: nines, un follet, una capsa de m\xFAsica amb una bonica ballarina i un grup de soldadets de plom. A un dels soldadets li faltava una cama, perqu\xE8 a l\u2019hora de fer-lo no van tenir suficient plom. El soldadet estava enamorat de la ballarina de la capsa de m\xFAsica, i ella tamb\xE9 n\u2019estava molt, d\u2019ell, ja que tots dos s\u2019aguantaven nom\xE9s d\u2019una cama. Per\xF2 el follet era molt gel\xF3s i no volia saber res d\u2019aquell soldat. Tan gel\xF3s estava que un mat\xED va llen\xE7ar al soldadet a la galleda de fregar. Ning\xFA no se'n va adonar, i el soldadet de plom va acabar al carrer amb les escombraries. \r\nUns nens que jugaven per all\xED li van construir un barquet de paper, i va surar pels canals fins que va desembocar en una claveguera. All\xED es va trobar amb una rata molt gran que va cridar: \xABQu\xE8 est\xE0s fent tu aqu\xED? Aquesta \xE9s la meva claveguera!\xBB. La rata estava a punt de devorar-lo quan va passar nedant un peix que se'l va empassar, i el soldadet va anar a parar a l'est\xF3mac del peix. \r\nNo va trigar el peix a ser pescat i anar a parar al mercat, just a la peixateria on comprava la majordoma de la fam\xEDlia. I precisament aquell dia va anar a la peixateria. Quan va ser a casa va trobar al soldadet a l'est\xF3mac del peix. Tothom es va alegrar molt, ja que l'havien buscat pertot arreu. \r\nUna nit, per\xF2, els nens es van deixar una finestra oberta i un cop de vent va llen\xE7ar el soldat a la llar de foc. El pobre soldat, com que era fet de plom, va comen\xE7ar a desfer-se. Llavors la ballarina, tota trista, va aprofitar un cop de vent per anar a parar junt amb el seu estimat. L\u2019endem\xE0 al mat\xED, amb les brases de la llar de foc, els nens van trobar un cor fet de plom, s\xEDmbol dels dos enamorats.\r\nI conte contat, ja s\u2019ha acabat.\r\n";
}
;
