_.getText = function getText_2(){
  return '\r\nHi havia una vegada fa molts i molts anys una nena anomenada Caputxeta Vermella, perqu\xE8 li agradava sortir a passejar amb una capa d\u2019un vermell rob\xED i una caputxa del mateix color, sobretot pels dies que feia fred i plovia. \r\n\r\nUn dia, la seva mare li va demanar que an\xE9s a veure la seva \xE0via, que estava malalta, i li port\xE9s un cistell de menjar. La mare li va dir que an\xE9s directament pel cam\xED que coneixien, advertint-la de no passar pel mig del bosc, ja que es deia que hi havia el Llop.\r\n\r\nLa Caputxeta Vermella va fer el que li deia la mare, per\xF2 passant prop del cam\xED es va oblidar del que li havia prom\xE8s i va decidir entrar al bosc a recollir unes flors per la seva \xE0via, ja que sabia que a ella li agradaven molt.\r\n\r\nDe sobte va apar\xE8ixer el Llop, que, mig disfressat, la va enganyar perqu\xE8 es qued\xE9s m\xE9s estona recollint flors, mentre ell anava a casa de l\u2019\xE0via per cruspir-se-la.\r\n\r\nSort que l\u2019\xE0via de la Caputxeta era molt espavilada, perqu\xE8 quan va sentir les passes del Llop, es va amagar dins l\u2019armari i s\u2019hi va tancar amb clau. El Llop, llavors, va decidir enganyar de nou la Caputxeta i es va posar una roba que l\u2019\xE0via havia deixat a prop, i tot disfressat es va posar a esperar la Caputxeta dins el llit, amb el llen\xE7ol que li cobria fins a la punta del nas.\r\n\r\nAix\xED que va arribar la noia i va veure la seva \xE0via, es va acostar al llit i li va preguntar com es trobava.\r\n\r\n-\xC0via, quina mala cara que fas\u2026.Com \xE9s que tens aquests ulls tan grans?\r\n\r\n- S\xF3n per veure\u2019t millor, filleta...Li contest\xE0 el Llop\r\n\r\n- I aquestes orelles tan grans\u2026\r\n\r\n- S\xF3n per sentir-te millor, petita\u2026\r\n\r\n- \xC0via, i aquestes dents tan grans..\r\n\r\n- S\xF3n per menjar-te millor!!, va dir el Llop, tirant-se-li al damunt.\r\n\r\nSort que mentrestant per all\xED passava un llenyataire que va sentir els crits de la Caputxeta, i de seguida va fer fugir el Llop amb la seva destral. La Caputxeta i el llenyataire van dir-li a l\u2019\xE0via que ja podia sortir del seu amagatall, i aquesta va c\xF3rrer a abra\xE7ar la seva n\xE9ta. Les dues van estar felices de retrobar-se i la Caputxeta li va prometre que mai m\xE9s faria cas de ning\xFA que no fos ella o la mare.\r\n\r\nI conte contat, ja s\u2019ha acabat.\r\n';
}
;
