_.getText = function getText_3(){
  return "La ciutat d'Hamel\xEDn estava assetjada per una plaga de rates i els seus habitants ho havien provat tot per desfer-se'n sense \xE8xit. Aleshores van cridar un m\xFAsic amb una flauta m\xE0gica, el qual va tocar una dol\xE7a melodia que va fer que les rates, hipnotitzades, el seguissin fins al riu, on es van ofegar totes. Els ciutadans, per\xF2, no van pagar el flautista all\xF2 acordat, de manera que ell va tocar una altra can\xE7\xF3, aquest cop per emportar-se tots els nens de la ciutat, excepte un dels nens, que era sord, i que va poder explicar als pares el que havia passat.\r\nFinalment, els ciutadans penedits van pagar el deute al flautista, i els nens van tornar sans i estalvis a casa seva. De les rates, ning\xFA no en va saber mai res m\xE9s.\r\nI conte contat, ja s\u2019ha acabat.\r\n";
}
;
