_.getText = function getText_4(){
  return "Hi havia una vegada un vell moliner que tenia tres fills, dels quals, al petit nom\xE9s li va deixar en her\xE8ncia un gat m\xE0gic, que tenia el do de parlar. El gat va dir-li al seu amo que no es preocup\xE9s, que ell l'ajudaria a fer-se ric. Vestit amb unes botes de seda vermelles, va anar al castell del rei a convidar-lo a visitar el Marqu\xE8s de Carab\xE0s, nom que es va inventar per al seu amo. El rei acced\xED i va muntar en la seva carrossa amb la seva filla.\r\nLlavors, el gat va amena\xE7ar els camperols de la vora dient-los que havien de dir que treballaven per al suposat marqu\xE8s, o se'ls menjaria. Aix\xED doncs, espantats per un gat que consideraven embruixat, tots deien al pas del rei que pertanyien al ric Marqu\xE8s de Carab\xE0s. En arribar a un llac, el gat va fer ficar el seu amo a dins i va comen\xE7ar a cridar que s'ofegava. El rei passava per all\xE0 i va ordenar els seus homes que el rescatessin i el vestissin, ja que el gat els assegur\xE0 que havien robat al seu amo, el gran marqu\xE8s. El rei el va dur a palau i, impressionat per la riquesa que se suposava que tenia i per l'enginy del jove, va decidir donar-li la m\xE0 de la seva filla i va nomenar el gat conseller del Regne.\r\n\r\nI vet aqu\xED un gos, i vet aqu\xED un gat, que aquest conte s\u2019ha acabat.\r\n";
}
;
