_.getText = function getText_5(){
  return "Un pobre pag\xE8s tenia un ase que li havia servit lleialment durant molts anys, per\xF2 les forces se li havien afeblit de manera que ja no servia per al treball. L'amo va pensar matar-lo per aprofitar-ne la pell, per\xF2 l'ase, comprenent que el vent bufava en contra seva, es va escapar i va prendre el cam\xED de Bremen.\r\n\r\n-All\xE0, va dir, podr\xE9 fer-me m\xFAsic de la ciutat.\r\n\r\nDespr\xE9s d'haver caminat per algun temps, va trobar en el cam\xED un gos de ca\xE7a, que bordava com un animal cansat d'una llarga carrera.\r\n\r\n-Per qu\xE8 bordes aix\xED, camarada? -li va dir.\r\n\r\n-Ah! -va contestar el gos; perqu\xE8 s\xF3c vell, vaig perdent forces de dia en dia, i no puc anar a ca\xE7ar, el meu amo ha volgut matar-me; jo he tocat el dos; per\xF2 com ho far\xE9 per buscar-me la vida?\r\n\r\n-No et procupis, li va dir l'ase; jo vaig a Bremen per fer-me m\xFAsic de la ciutat; vine amb mi i procura que et rebin tamb\xE9 a la banda. Jo tocar\xE9 la trompa, i tu tocar\xE0s els timbals.\r\n\r\nEl gos va acceptar i van continuar junts el seu cam\xED. Una mica m\xE9s endavant van trobar un gat tirat en el cam\xED amb una cara ben trista, perqu\xE8 feia tres dies que estava plovent.\r\n\r\n-Qu\xE8 tens, vell bigotut? -li va dir l'ase.\r\n\r\n-Estic trist perqu\xE8 la meva edat \xE9s una cosa avan\xE7ada, les meves dents estan una mica gastades, i m'agrada m\xE9s dormir al costat de la llar que c\xF3rrer darrera dels ratolins, aix\xED que el meu amo ha volgut matar-me, per\xF2 m'he salvat a temps. Qu\xE8 he de fer ara? On he d'anar?\r\n\r\n-Vine amb nosaltres a Bremen, tu entens molt b\xE9 la m\xFAsica nocturna, i et far\xE0s com nosaltres m\xFAsic de la ciutat.\r\n\r\nVa agradar al gat el consell i va partir amb ells. Els nostres viatgers van passar ben aviat per davant d'un corral. Damunt la porta hi havia un gall que cantava amb totes les seves forces.\r\n\r\n-Per qu\xE8 crides d'aquesta manera? -va dir l'ase.\r\n\r\n-Estic anunciant el bon temps, va contestar el gall, i com dem\xE0 \xE9s diumenge hi ha un gran dinar a casa, i la mestressa sense la menor compassi\xF3 ha dit a la cuinera que em menjar\xE0 amb arr\xF2s. Aix\xED he cridat amb totes les meves forces, no sense certa satisfacci\xF3, veient que respiro encara.\r\n\r\n-Cresta Vermella, va dir l'ase; vine amb nosaltres a Bremen; a  qualsevol lloc trobar\xE0s una cosa una mica millor que la mort. Tu tens bona veu, i quan cantem junts, farem un concert admirable.\r\n\r\nVa agradar al gall la proposta i van comen\xE7ar a caminar els quatre junts; per\xF2 no podien arribar a aquell dia a la ciutat de Bremen; al vespre van parar en un bosc, on van decidir passar la nit. L'ase, el gos, i el gat es van col\xB7locar sota un arbre molt gran i el gall va volar per col\xB7locar-se en un lloc m\xE9s elevat, on es creia m\xE9s segur. Abans de dormir, quan passejava les seves mirades cap als quatre vents, li va semblar veure al lluny com una llum i va dir als seus companys que hi havia d'haver alguna casa a prop, ja que es distingia prou claredat.\r\n\r\n-Sent aix\xED, va contestar l'ase, marxem de pressa cap all\xE0, ja que aquest lloc no \xE9s molt del meu gust.\r\n\r\nA la qual cosa va afegir el gos:\r\n\r\n-En efecte, no em vindrien malament alguns ossos amb una mica de carn.\r\n\r\nEs van dirigir cap al punt d'on sortia la llum; no van trigar a veure-la brillar i engrandir-se, fins que per fi van arribar a una casa de lladres molt ben il\xB7luminada.\r\n\r\nL'ase, que era el m\xE9s gran de tots, es va acostar a la casa i va mirar dins.\r\n\r\n-Qu\xE8 veus, ase? -li va preguntar el gall.\r\n\r\n-Que qu\xE8 veig? -va dir l'ase. Una taula plena de menjars i ampolles i al voltant uns lladres, que segons sembla no ho passen gens malament.\r\n\r\n-Quin bon negoci seria aquest per a nosaltres! -va afegir el gall.\r\n\r\n-De segur, va reposar l'ase; Ah!, si estigu\xE9ssim dins!\r\n\r\nVan comen\xE7ar a idear una manera per fer fora d'all\xE0 als lladres i per fi la van trobar. L'ase es va posar sota, col\xB7locant els seus peus davanters sobre del pedr\xEDs de la finestra; el gos va muntar sobre l'esquena de l'ase, el gat va enfilar-se a sobre del gos, i el gall va volar i es va col\xB7locar a sobre del cap del gat. Col\xB7locats d'aquesta manera, van comen\xE7ar tots la seva m\xFAsica a un senyal convingut. L'ase va comen\xE7ar a bramar, el gos a bordar, el gat a miolar i el gall a cantar, despr\xE9s es va precipitar per la finestra dins de la cambra trencant els vidres, que van volar en mil trossos. Els lladres, en sentir aquell espant\xF3s soroll, van creure que entrava a la sala algun espectre i van escapar espantats al bosc. Llavors els quatre companys es van asseure a la taula, es van arreglar amb el que quedava i van menjar com si haguessin dejunat un mes.\r\n\r\nTot just van haver acabat els quatre instrumentistes, que van apagar els llums i van buscar un lloc per descansar cadasc\xFA segons al seu gust. L'ase es va ficar al llit en els fems, el gos darrere de la porta, el gat a la llar, a prop de la cendra calenta, el gall en una biga, i com estaven cansats del seu llarg viatge, no van trigar a adormir-se. Despr\xE9s de mitjanit, quan els lladres van veure de lluny que no hi havia llum a la casa i que tot semblava tranquil, els va dir el capit\xE0:\r\n\r\n-No hem hagut de deixar-nos derrotar d'aquesta manera.\r\n\r\nI va manar a un dels seus que an\xE9s a veure el que passava a la casa. L'enviat ho va trobar tot tranquil; va entrar a la cuina i va anar a encendre la llum; va agafar una palleta i com els inflamats i brillants ulls del gat li semblaven dues brases, hi va acostar la palleta per encendre-la; per\xF2 com que el gat no entenia de bromes, va saltar-li a la cara i li va esgarrapar bufant. Ple d'una horrible por va comen\xE7ar a c\xF3rrer el nostre home per fugir cap a la porta, per\xF2 el gos, que estava estirat al darrera, es va tirar damunt seu i li va mossegar una cama; quan passava pel corral al costat del fem, li va deixar anar un parell de guitzes l'ase, mentre el gall, despert amb el soroll i alerta ja, cridava: qui qui ri qui! -des dalt de la biga.\r\n\r\nEl lladre va c\xF3rrer a corre-cuita cap a on estava el seu capit\xE0 i li va dir:\r\n\r\n-Hi ha a casa nostra una horrorosa bruixa que m'ha esgarrapat, bufant, amb les seves llargues ungles; al costat de la porta es troba un home armat amb un enorme ganivet, que m'ha travessat la cama; al pati hi ha un monstre negre que m'ha bastonejat amb els cops de la seva ma\xE7a, i a la part alta del sostre s'ha col\xB7locat el jutge que cridava:\r\n\r\n-\xA1Porteu-me\u2019l aqu\xED, porteu-me\u2019l aqu\xED, davant meu! -pel que he cregut havia de fugir.\r\n\r\nDes de llavors no es van atrevir els lladres a entrar m\xE9s a la casa, i els quatre m\xFAsics de Bremen es trobaven tan b\xE9 en ella que no van voler abandonar-la.\r\n\r\nI conte contat, ja s\u2019ha acabat.\r\n\r\n";
}
;
