_.getText = function getText_6(){
  return 'Hi havia una vegada un nen molt rebonic a qui anomenaven Patufet, perqu\xE8 de tots els nens i nenes del poble, era el m\xE9s petit de tots. De fet, no passava d\u2019un pam d\u2019alt. Tot i aix\xF2, era d\u2019all\xF2 m\xE9s intel.ligent i els seus pares confiaven molt en ell. Un mat\xED, la mare li va encarregar de portar un cistell amb el menjar al seu pare, que estava al camp treballant. Com que era tan baixet, el noiet anava cantant ben fort pel cam\xED perqu\xE8 ning\xFA el trepitg\xE9s..\r\nPatim, patam, patum, homes i dones del cap dret, patim, patam, patum, no trepitgeu en Patufet.\r\nI tots aquells que passaven pel cam\xED es quedaven meravellats de sentir aquella veu per\xF2 no veure ning\xFA, fins que es fixaven, que, m\xE9s avall dels seus caps, hi havia un nen que portava una cistella!\r\nAx\xED cantant, cantant, en Patufet va arribar al camp on treballava el seu pare. Per\xF2, ai las!, de sobte va esclatar una tempesta molt forta, amb llamps i trons i pluja a dojo...i en Patufet va c\xF3rrer a aixoplugar-se darrera una col que hi havia en un camp proper. La mala sort va fer que per all\xED pass\xE9s un bou que tenia molta gana, que en un tres i no res es va empassar la col i en Patufet, que hi era dins!\r\nQuan el pare va arribar a casa despr\xE9s de treballar al camp, la mare li va preguntar si en Patufet li havia portat el dinar. Quan ell li va dir que no, es van espantar molt, i van sortir corrents a buscar-lo\u2026.\r\n-Patufeeeet, on eeeets? - Patufeeet, on eeets?\r\nDe sobte van sentir una veueta\u2026\r\nS\xF3c a la panxa del bou, on no neva ni plou!\r\nGr\xE0cies a aix\xF2, els pares es van adonar que aquell bou tan gros que hi havia pasturant s\u2019havia cruspit en Patufet. Llavors van decidir donar-li tot el menjar que van trobar per afartar-lo. I el bou, tip i ple com estava, va fer un pet com un gla i disparat va sortir en Patufet!!\r\nEls tres van tornar contents a casa cantant la can\xE7\xF3 del Patufet.\r\nPatim, patam, patum, homes i dones del cap dret, patim, patam, patum, no trepitgeu en Patufet.\r\nI conte contat, ja s\u2019ha acabat.\r\n';
}
;
