_.getText = function getText_7(){
  return "Una nit una petita oreneta volava sobre una ciutat on es trobava una bella est\xE0tua. Quan la veure, es va adonar que estava recoberta amb fines l\xE0mines d'or; els seus ulls eren dos safirs i un gran rob\xED era al pom de la seva espasa. L'est\xE0tua del pr\xEDncep fou constru\xEFda despr\xE9s de la seva mort, quan ell no coneixia la tristor -vivia en un palau on tothom estava content i feli\xE7 sempre. La cort el coneixia com a Pr\xEDncep Feli\xE7, i quan mor\xED els consellers del poble decidiren construir l'est\xE0tua, prou alta perqu\xE8 el pogu\xE9s contemplar tota la ciutat.\r\nL'oreneta va decidir dormir sota l'est\xE0tua, per\xF2 quan estava a punt de quedar-se dormida, li va caure a sobre una gota d'aigua. Quan va al\xE7ar la vista, va veure el Pr\xEDncep Feli\xE7 que plorava per la mis\xE8ria que hi havia a la seva ciutat. Per aix\xF2 va demanar a l'oreneta que fos el seu missatger. A trav\xE9s d'una petita finestra el Pr\xEDncep Feli\xE7 va veure una modista molt pobra, i tamb\xE9 va poder veure el seu fill malalt. Com que no tenien res per menjar, va dir a l'oreneta que els dugu\xE9s el rob\xED de la seva espasa.\r\nLa nit seg\xFCent el Pr\xEDncep Feli\xE7 va veure un home en unes golfes molt fredes intentant acabar una obra de teatre, per\xF2 tenia massa fred per escriure. Per aix\xF2, el Pr\xEDncep Feli\xE7 va dir a l'oreneta que li tragu\xE9s un ull (que era un safir) i li d\xF3nes a aquell home, perqu\xE8 aix\xED pogu\xE9s comprar fusta per fer-se un foc. El pr\xF2xim dia, va veure una noia a qui li havien caigut els llumins a l'aigua, i el seu pare li pegaria molt si no tornava amb els diners de vendre\u2019ls. Va conv\xE8ncer l'oreneta perqu\xE8 li port\xE9s l'altre safir, tornant-se aix\xED cec.\r\nA causa de la seva ceguesa, l'oreneta li havia d\u2019anar explicant a qui m\xE9s veia miserable. L\u2019oreneta li va explicar que hi havia dos nens plorant de fam, per tant el Pr\xEDncep Feli\xE7 va decidir portar-los totes les l\xE0mines d'or amb les quals estava recobert. L\u2019oreneta es va quedar amb el Pr\xEDncep Feli\xE7 per ajudar-lo, tot i que feia un fred hivernal. Per\xF2 una nit, sabent que potser moriria de fred, li va fer un pet\xF3 als llavis abans de dormir. Just en aquell moment, a l'interior de l'est\xE0tua s'hi va sentir un soroll met\xE0l\xB7lic: el cor de plom que s'havia trencat.\r\nEl mat\xED seg\xFCent, l'alcalde de la ciutat va veure l'est\xE0tua, tota nua de les seves joies, i va decidir que ja no era d'utilitat, i que per tant s\u2019havia de fondre. L'est\xE0tua es va fondre per tornar-ne a utlitzar el plom. Aix\xF2 no obstant, el cor de plom va ser incapa\xE7 de fondre's, i es va llen\xE7ar a les escombraries juntament amb l'oreneta. Per\xF2 una fada va rescatar el bondad\xF3s cor del pr\xEDncep i a la petita oreneta i els va dur a la reina del pa\xEDs de les fades, on van viure per sempre m\xE9s.\r\nI conte contat, ja s\u2019ha acabat.\r\n";
}
;
