_.getText = function getText_8(){
  return 'Hi havia una vegada un pr\xEDncep que cercava una princesa per casar-s\u2019hi. Per\xF2 havia de ser una veritable princesa. Cap va superar la prova fins que un dia d\u2019una forta tempesta va arribar a palau una princesa, per\xF2 que duia tota la roba mullada i els cabells xops. Per tal de comprovar que era qui deia, va passar la nit com a convidada en una habitaci\xF3 molt luxosa, amb un llit de vint matalassos i vint flassades, per\xF2 a sota de tot hi van col.locar un p\xE8sol. \r\nA l\u2019endem\xE0 al mat\xED, el pr\xEDncep li va preguntar com havia dormit, i ella li contest\xE0 que molt malament, ja que alguna cosa li havia fet nosa a l\u2019esquena i no havia pogut aclucar l\u2019ull. El pr\xEDncep reconegu\xE9 que la noia era una princesa de deb\xF2, ja que nom\xE9s les veritables princeses tene la pell tan delicada, aix\xED que la va triar com a la seva dona.\r\n\r\nI conte contat, ja s\u2019ha acabat.\r\n';
}
;
