_.getText = function getText_9(){
  return "Hi havia una vegada un matrimoni que desitjava feia molt de temps tenir un fill, i aix\xED va ser finalment. En l'alcova dels esposos hi havia una finestra petita, les vistes de la qual donaven a un bell hort, on es trobaven tota mena de flors i llegums. Es trobava emper\xF2 envoltat d'una alta paret, i ning\xFA s'atrevia a entrar-hi dins, perqu\xE8 pertanyia a una bruixa molt poderosa i temuda de tots. Un dia estava la dona a la finestra mirant a l'hort quan va veure un munt de maduixes i la van semblar tan vermelles i tan fresques, que va sentir gust per menjar-les. Va cr\xE9ixer el seu desig de dia en dia i, com no ignorava que no el podia satisfer, va comen\xE7ar a estar trista, p\xE0l\xB7lida i malaltissa. El seu marit es va espantar en veure-la aix\xED i li va preguntar:\r\n-Qu\xE8 tens, estimada esposa?\r\n-Oh! li va contestar, si no puc menjar les maduixes que hi ha darrere de casa, em morir\xE9 de ben segur.\r\nEl marit, que l'estimava molt, va pensar que abans que es mor\xEDs la seva dona, preferia entrar a l\u2019hort male\xEFt.\r\nAl vespre va saltar les parets de l'hort de la bruixa, va agafar en un moment un grapat de maduixes, i li va portar a la seva dona, que se les va menjar de seguida.. Per\xF2 li van agradar tant tant, que l'endem\xE0 tenia molta m\xE9s gana i li va demanar al seu marit que torn\xE9s  altra vegada a l'hort. Ell hi va tornar al seg\xFCent vespre. per\xF2 aquesta vegada hi va trobar la bruixa.\r\n-Com t'atreveixes, li va dir enfurismada, a venir al meu hort i robar-me les maduixes com un lladre? \xBFNo saps que pot venir-te una desgr\xE0cia?\r\n-Ah! li va contestar, perdoneu el meu atreviment, ja que ho he fet per necessitat. La meva dona ha vist les maduixes des de la finestra, i li han vingut tant de gust que si no li portava es moriria.\r\nLa bruixa li va dir llavors:\r\n-Si \xE9s aix\xED com dius, agafa tantes maduixes com vulguis, per\xF2 amb una condici\xF3: has de lliurar-me el fill que doni a llum la teva dona. Res li faltar\xE0, i el cuidar\xE9 com si fos la seva mare.\r\nEl marit es va comprometre amb pena, i quan la seva dona va donar a llum li va presentar la seva filla a la bruixa, que va posar a la nena el nom de Rapunzel i se la va emportar.\r\nRapunzel era la criatura m\xE9s bella que hi ha hagut sota el sol. Quan va complir dotze anys la fetillera la va tancar en una torre que hi havia en un bosc, la qual no tenia escala ni porta, sin\xF3 \xFAnicament una finestra molt petita i alta. Quan la bruixa volia entrar es posava sota la finestra i deia:\r\nRapunzel, Rapunzel,\r\ntira els teus cabells\r\npujar\xE9 per ells.\r\nDoncs Rapunzel tenia uns cabells molt llargs i bells i tan fins com l'or filat. Tot just sentia la veu de la bruixa, desfermava la seva trena, la deixava caure des de dalt de la finestra, que es trobava a m\xE9s de vint metres del terra, i la bruixa pujava llavors per ella.\r\nVan passar els anys, i una dia va passar per aquell bosc el fill del rei i es va acostar a la torre en sentir un c\xE0ntic tan dol\xE7 i suau que el va fer parar a escoltar. Era Rapunzel que passava el temps en la seva solitud entretenint-se a repetir amb la seva dol\xE7a veu les m\xE9s agradables can\xE7ons. El fill del rei hagu\xE9s volgut entrar, i va buscar la porta de la torre, per\xF2 no va poder trobar-la. Va marxar cap a casa, per\xF2 el c\xE0ntic havia penetrat de tal manera en el seu cor, que anava cada dia al bosc a escoltar-lo. Estant un dia rere un arbre, va veure que arribava una bruixa, i la va sentir dir:\r\nRapunzel, Rapunzel,\r\ntira els teus cabells\r\npujar\xE9 per ells.\r\nRapunzel va deixar llavors caure la seva cabellera i la bruixa va pujar a la torre.\r\nSi \xE9s aquesta l'escala per on es puja, va dir el pr\xEDncep, vull jo tamb\xE9 provar fortuna.\r\nI l'endem\xE0, quan comen\xE7ava a fosquejar es va acostar a la torre i va dir:\r\nRapunzel, Rapunzel,\r\ntira els teus cabells\r\npujar\xE9 per ells.\r\nDe seguida van caure els cabells i va pujar el fill del rei. Al principi es va espantar Rapunzel quan va veure entrar un home, ja que els seus ulls no n\u2019havien vist encara cap, per\xF2 el fill del rei va comen\xE7ar a parlar-li amb la major amabilitat, i li va referir que el seu c\xE0ntic havia commogut de tal manera el seu cor, que des de llavors no havia pogut descansar un sol instant i s'havia proposat veure-la i parlar-li. Va desapar\xE8ixer amb aix\xF2 la por de Rapunzel i quan li va preguntar si volia casar-se amb ell, i va veure que era jove i bon mosso, li va dir que s\xED, i va estr\xE8nyer la m\xE0 amb la seva, afegint:\r\n-De bona gana marxaria amb tu, per\xF2 ignoro com he de baixar; sempre que vinguis porta\u2019m cordons de seda amb els quals anir\xE9 fent una escala, i quan sigui prou llarga, baixar\xE9, i em portar\xE0s en el teu cavall.\r\nVan convenir en qu\xE8 hi aniria cada nit, ja que la bruixa hi anava de dia, la qual no va notar res fins que un dia li va preguntar Rapunzel:\r\n-Digues, \xE0via, com \xE9s que trigues tant de temps a pujar, mentre el fill del rei arriba en un moment al meu costat?\r\n-Ah, m\xFArria! li va contestar la bruixa. Que \xE9s el que sento! Jo que creia haver-te ocultat a tothom, i m'has enganyat!\r\nVa agafar llavors els bells cabells de Rapunzel, els va donar un parell de voltes a la m\xE0 esquerra, va prendre unes tisores amb la dreta, i els va tallar, caient a terra les belles trenes, i va arribar a tal extrem la seva f\xFAria que va portar a la pobra Rapunzel a un desert, on la va condemnar a viure entre ll\xE0grimes i dolors.\r\nEl mateix dia en qu\xE8 va descobrir la bruixa el secret de Rapunzel, va prendre a la nit els cabells que l'havia tallat, els va assegurar a la finestra, i quan va venir el pr\xEDncep va dir:\r\nRapunzel, Rapunzel,\r\ntira els teus cabells\r\npujar\xE9 per ells,\r\nels va trobar penjant. El fill del rei va pujar llavors, per\xF2 no va trobar a la seva estimada Rapunzel, sin\xF3 a la bruixa, que el va rebre amb la pitjor cara del m\xF3n.\r\n-Hola! li va dir burleta, v\xE9ns a buscar a la teva estimada, per\xF2 l'ocell no est\xE0 ja en el seu niu i no tornar\xE0 a cantar; l\u2019han tret de la seva g\xE0bia i els teus ulls no el veuran ja m\xE9s. Rapunzel \xE9s cosa perduda per a tu, no la trobar\xE0s mai.\r\nEl pr\xEDncep va sentir el dolor m\xE9s profund i en la seva desesperaci\xF3 va saltar de la torre; va tenir la fortuna de no perdre la vida, per\xF2 els esbarzers en qu\xE8 va caure li van ferir els ulls. Va comen\xE7ar a caminar a cegues pel bosc, no menjava m\xE9s que arrels i herbes i nom\xE9s s'ocupava en lamentar-se i plorar la p\xE8rdua de la seva estimada. Va vagar aix\xED durant algun temps en la major mis\xE8ria, fins que va arribar finalment al desert on vivia Rapunzel en cont\xEDnua angoixa. Va sentir la seva veu i va creure con\xE8ixer-la, i quan va arribar a prop seu es va llan\xE7ar al seu coll i va plorar amargament. Les ll\xE0grimes que sortiren dels seus ulls, li van tornar la seva antiga claredat i va tornar a veure-hi com abans. La va portar al seu regne, on van ser rebuts amb gran alegria, i van viure molts anys feli\xE7os i contents.\r\n\r\nI conte contat, ja s\u2019ha acabat.\r\n";
}
;
